INSERT INTO `posts` VALUES ('153123704737554_154548414619234',153123704737554,153123704737554,NULL,'',NULL,NULL,'link',NULL,NULL,0,4,'2011-07-28 15:51:14','2011-07-28 15:51:14'),('153123704737554_172861112823897',153123704737554,153123704737554,NULL,'Hong Kong is definitely one of the most heavily populated places I\'ve ever lived. And people here are very smart about how they use their space as there is so little of it. But this takes space management to a new level! What\'s really mind-blowing is how as soon as the train passes, the market takes over the space once again and you would never know that there was a train at all! Amazing...',NULL,NULL,'video',NULL,NULL,36,176,'2012-02-13 12:02:41','2012-02-13 12:02:41'),('153123704737554_173582946065977',153123704737554,153123704737554,NULL,'I\'ve been listening to this song all day and ran across these guys while trying to find the video. The people walking in and out in the back are really funny, and these two guys and gorgeous girl are so good!',NULL,NULL,'video',NULL,NULL,15,126,'2011-11-29 07:32:28','2011-04-11 14:16:34'),('153123704737554_185697484849795',153123704737554,153123704737554,NULL,'Hey guys! Check out my new website! It\'s something that I think every girl will love. 5 cosmetic samples a month right to your doorstep! Check it out and tell me what you think :-)',NULL,NULL,'link',NULL,NULL,16,77,'2011-01-12 05:56:16','2011-11-11 14:54:39'),('153123704737554_202281519821772',153123704737554,153123704737554,NULL,'',NULL,NULL,'status',NULL,NULL,0,0,'2011-07-17 05:19:15','2011-07-17 05:19:15'),('153123704737554_203756543007603',153123704737554,153123704737554,NULL,'Hotpot in Thailand! Its actually really good! Hahahaha!',NULL,NULL,'photo',NULL,NULL,4,18,'2012-02-05 13:59:54','2011-07-20 03:08:04'),('153123704737554_205162039533720',153123704737554,153123704737554,NULL,'',NULL,NULL,'status',NULL,NULL,0,0,'2011-07-23 07:45:14','2011-07-23 07:45:14'),('153123704737554_205602589489665',153123704737554,153123704737554,NULL,'Just had an amazing couple of days with my husband in Thailand at the resort Sri Panwa. We both needed a few days vacation and this was the perfect place to do \ngo. I hope to go back very soon! :-)',NULL,NULL,'photo',NULL,NULL,9,24,'2012-11-02 01:45:11','2011-07-24 10:38:48'),('153123704737554_205603029489621',153123704737554,153123704737554,NULL,'This picture is from our swimming pool. What a beautiful view!',NULL,NULL,'photo',NULL,NULL,1,26,'2011-11-21 08:28:21','2011-07-24 10:40:26'),('153123704737554_207356015980989',153123704737554,153123704737554,NULL,'',NULL,NULL,'photo',NULL,NULL,0,13,'2011-07-28 04:23:53','2011-07-28 04:23:53'),('153123704737554_212408708809053',153123704737554,153123704737554,NULL,'Just about to start Ming Fung Jewelry show at Four Seasons HK. Add oil :) !',NULL,NULL,'photo',NULL,NULL,6,23,'2012-05-20 13:46:43','2011-08-08 06:17:09'),('153123704737554_216802125036378',153123704737554,153123704737554,NULL,'Me melting today while shooting Channel V. Today was a real stinker! Got to work with Cara G which was a lot of fun. We always have a lot of fun together!',NULL,NULL,'photo',NULL,NULL,5,23,'2011-11-21 08:27:35','2011-08-17 15:22:36'),('153123704737554_216873098424991',153123704737554,153123704737554,NULL,'This video is so cool! This song was originally by Gotye, but this version is by Walk Off The Earth. It\'s really fascinating watching this many people play one guitar. I\'ve watched it about 100 times and it never seems to get old :-)',NULL,NULL,'video',NULL,NULL,30,216,'2012-05-20 13:35:23','2012-01-05 15:04:25'),('153123704737554_217594028290521',153123704737554,153123704737554,NULL,'Me and my good friend Bernice at the Coach Party, I haven\'t seen her long time, it was so nice to have a chat!',NULL,NULL,'photo',NULL,NULL,2,26,'2012-03-29 13:41:03','2011-08-19 04:20:55'),('153123704737554_217607388289185',153123704737554,153123704737554,NULL,'The Kamill Print Ad making of! :)',NULL,NULL,'photo',NULL,NULL,1,13,'2012-04-21 23:44:42','2011-08-19 05:09:26'),('153123704737554_217996884916902',153123704737554,153123704737554,NULL,'Having Fun with my good friends@Gucci show!',NULL,NULL,'photo',NULL,NULL,3,32,'2011-11-21 08:27:10','2011-08-20 01:22:06'),('153123704737554_218518878198036',153123704737554,153123704737554,NULL,'Hahaha! Hard selling my favorite product Kamill, you can buy it in HK！',NULL,NULL,'photo',NULL,NULL,4,33,'2012-01-18 13:20:55','2011-08-21 05:41:46'),('153123704737554_218552234861367',153123704737554,153123704737554,NULL,'',NULL,NULL,'status',NULL,NULL,0,0,'2011-08-21 08:31:54','2011-08-21 08:31:54'),('153123704737554_220018874714703',153123704737554,153123704737554,NULL,'',NULL,NULL,'photo',NULL,NULL,9,48,'2012-05-03 11:46:27','2011-08-24 09:56:50'),('153123704737554_220624854654105',153123704737554,153123704737554,NULL,'',NULL,NULL,'photo',NULL,NULL,0,3,'2011-08-25 16:16:36','2011-08-25 16:16:36'),('153123704737554_220625824654008',153123704737554,153123704737554,NULL,'',NULL,NULL,'photo',NULL,NULL,0,4,'2011-08-25 16:19:02','2011-08-25 16:19:02'),('153123704737554_220630451320212',153123704737554,153123704737554,NULL,'',NULL,NULL,'photo',NULL,NULL,5,9,'2012-08-05 18:16:37','2011-08-25 16:30:54'),('153123704737554_220631687986755',153123704737554,153123704737554,NULL,'',NULL,NULL,'photo',NULL,NULL,4,17,'2012-04-17 02:44:32','2011-08-25 16:33:53'),('153123704737554_221903241192933',153123704737554,153123704737554,NULL,'Did an event today with children. They were so cute! And they had so much confidence. I think they might steal my job as a model hahaha! :-)',NULL,NULL,'photo',NULL,NULL,1,12,'2012-03-22 13:16:52','2011-08-28 11:30:42'),('153123704737554_221903571192900',153123704737554,153123704737554,NULL,'So much fun today hanging out with the cute kids!',NULL,NULL,'photo',NULL,NULL,0,15,'2011-08-28 11:31:52','2011-08-28 11:31:52'),('153123704737554_222929417756982',153123704737554,153123704737554,NULL,'',NULL,NULL,'photo',NULL,NULL,6,28,'2012-03-29 00:22:05','2011-0