ou imagine living next to these people? And yes this is real.',NULL,NULL,'video',NULL,NULL,9,100,'2011-03-11 03:42:24','2011-10-28 13:13:00'),('153123704737554_242404329142824',153123704737554,153123704737554,NULL,'My sister and I at the wedding of the year in Jakarta Indonesia. Congratulations to Steven and Ellen Barkie!',NULL,NULL,'photo',NULL,NULL,23,141,'2012-02-24 17:36:18','2011-10-15 14:47:13'),('153123704737554_243135705736353',153123704737554,153123704737554,NULL,'At my shoot today with my makeup artist Karen aka Ka Lam, and her twin sister Carol, aka Ka Lo. They are so darn cute! And I am kinda freakishly tall...or are they freakishly small? hahahaha!!',NULL,NULL,'photo',NULL,NULL,33,175,'2011-10-17 09:56:08','2011-10-17 09:56:08'),('153123704737554_244388798944377',153123704737554,153123704737554,NULL,'Dom Lau and I having a blast on the E! News Asia set. Like always!! He\'s a total goof ball and I love it :-)',NULL,NULL,'photo',NULL,NULL,29,135,'2012-01-19 05:19:27','2011-10-20 10:36:11'),('153123704737554_245195885530335',153123704737554,153123704737554,NULL,'About to interview British Boy band Blue. Anyone got any good questions for them?',NULL,NULL,'status',NULL,NULL,31,79,'2011-10-22 07:09:39','2011-10-22 07:09:39'),('153123704737554_246046835445240',153123704737554,153123704737554,NULL,'Eating my favorite food in the world! Yea I LOVE HOT POT!!!',NULL,NULL,'photo',NULL,NULL,30,178,'2012-02-29 19:31:56','2011-10-24 10:51:40'),('153123704737554_246823428696573',153123704737554,153123704737554,NULL,'Cutest little guy EVER!!!! And no, it is not recommended that you keep one as a pet. Yea, don\'t think I didn\'t ask about it. I am such a sucker for all cute animals. If it were my choice I would be living with a herd of meerkats already :-)',NULL,NULL,'video',NULL,NULL,7,34,'2012-04-21 13:25:13','2011-03-10 03:00:17'),('153123704737554_248482558535001',153123704737554,153123704737554,NULL,'',NULL,NULL,'status',NULL,NULL,0,0,'2011-10-30 06:58:38','2011-10-