o so this is all I could post. These guys were pioneers and were the soundtrack to many years of my life. ',NULL,NULL,'video',NULL,NULL,29,131,'2012-05-18 22:25:57','2012-05-05 13:50:37'),('153123704737554_292952890715523',153123704737554,153123704737554,NULL,'These cats are so incredibly talented! hahaha! They are actually better then half the DJ\'s in this town! hahaha. ',NULL,NULL,'video',NULL,NULL,0,40,'2011-10-10 02:17:13','2011-10-10 02:17:13'),('153123704737554_294003170649606',153123704737554,153123704737554,NULL,'',NULL,NULL,'photo',NULL,NULL,92,403,'2012-01-23 10:58:45','2012-01-23 10:58:45'),('153123704737554_294041493945526',153123704737554,153123704737554,NULL,'Check these guys out! So cool!! Makes me want to dance around my room with a glowstick :-P',NULL,NULL,'video',NULL,NULL,2,11,'2012-04-21 13:26:02','2011-09-23 12:05:19'),('153123704737554_298869230163000',153123704737554,153123704737554,NULL,'Another animal photo! Yep I love my animals :-). Went to the Lone Pine Koala sanctuary in Brisbane yesterday and played with more koalas as well as these super friendly kangaroos. They loved being scratched just like dogs. It was soooo cute!! They remind me of my dog Renee. Same eyes. And same loving nature.',NULL,NULL,'photo',NULL,NULL,76,540,'2012-01-31 03:04:54','2012-01-31 03:04:54'),('153123704737554_300246603358596',153123704737554,153123704737554,NULL,'I\'ve just recently reached 100,000 likes and I just want to say thanks to all you guys! Hope everyone has an amazing Year of the Dragon :-)',NULL,NULL,'status',NULL,NULL,31,334,'2012-02-02 08:38:44','2012-02-02 08:38:44'),('153123704737554_304297352942970',153123704737554,153123704737554,NULL,'This is so hilarious! It was done in Singapore. It\'s so funny seeing how shocked the people who are trying to take a photo are when the group walks away. Priceless! ',NULL,NULL,'video',NULL,NULL,32,168,'2011-12-30 08:57:23','2011-12-30 08:57:23'),('153123704737554_308837932475522',153123704737554,153123704737554,NULL,'A video of my friend Jun Kung reviewing the Blackberry Bold 9900. I am also a huge fan of this phone. Hands down the best BB so far! Oh, and Jun is an AMAZING musician just for your information :-) He\'s one of those people that could probably make chopsticks and a soda can sound amazing when being banged together. ',NULL,NULL,'video',NULL,NULL,1,113,'2011-08-11 16:10:32','2011-08-11 11:07:28'),('153123704737554_310043372378919',153123704737554,153123704737554,NULL,'',NULL,NULL,'status',NULL,NULL,0,0,'2012-02-17 13:42:26','2012-02-17 13:42:26'),('153123704737554_313738015342788',153123704737554,153123704737554,NULL,'Good morning South Africa! Enjoying the view from our mountain hide away. So nice to be breathing clean smog free air! It\'s actually a shock to my system. My lungs are confused hahaha!',NULL,NULL,'photo',NULL,NULL,69,333,'2012-02-23 08:43:34','2012-02-23 08:43:34'),('153123704737554_316758111707445',153123704737554,153123704737554,NULL,'We went fishing the other day and this dragonfly came and sat right next to me. We have them in Hong Kong too but not as colorful as the ones here. There are also red and green ones. Beautiful creatures!',NULL,NULL,'photo',NULL,NULL,29,280,'2012-04-20 17:26:18','2012-02-28 16:30:14'),('153123704737554_321426961240560',153123704737554,153123704737554,NULL,'Introducing Lady Brie Camembert. Funny name. She keeps coming into our front porch just to say hi. She acts very similar to a dog. And she\'s very naughty. Just like a child.',NULL,NULL,'photo',NULL,NULL,44,257,'2012-07-03 15:38:01','2012-07-03 15:38:01'),('153123704737554_329986960384560',153123704737554,153123704737554,NULL,'Daniel and I at a FilmAid gala dinner honoring Keanu Reeves and Duncan Jepson for their contributions and involvements in charitable causes. Its such an amazing charity organization. And being able to hang out with my hubby is always a bonus! :-)',NULL,NULL,'photo',NULL,NULL,64,429,'2012-03-22 11:38:54','2012-03-22 11:38:54'),('153123704737