www.avclub.com/toronto/articles/cmw-2012-planner-wednesday-march-21,71218/',NULL,NULL,'link',NULL,NULL,0,5,'2012-03-23 02:42:57','2012-03-23 02:42:57'),('311212142273778_188716484573888',311212142273778,311212142273778,NULL,'ONE DAY AWAY FROM 2K12 KOREA NIGHT!  We\'ll be announcing our winner later on today -- sorry, we\'re just making sure we\'re ready to handle the awesome support from all of you!  Get your tickets now: http://bit.ly/xeC7z8 -- Support KPOP in Toronto!!!',NULL,NULL,'link',NULL,NULL,2,11,'2012-03-20 14:53:00','2012-03-20 14:34:38'),('311212142273778_193881684066242',100001400629398,311212142273778,NULL,'2 days left! Do not wait until the last minute. Enter today!\nhttp://youtu.be/h7TMb31R-dw',NULL,NULL,'video',NULL,NULL,0,0,'2012-04-28 02:12:04','2012-04-28 02:12:04'),('311212142273778_208625125909298',311212142273778,311212142273778,NULL,'Wondering who to check out during the Canadian Music Festival? Forget The Box gives K-Pop a big YES!\n\nhttp://www.forgetthebox.net/mag/arts/we-heart-music/canadian-music-week-indie-electro-and-k-pop.php',NULL,NULL,'link',NULL,NULL,3,5,'2012-03-23 02:44:44','2012-03-23 02:39:58'),('311212142273778_296964580372841',100001400629398,311212142273778,NULL,'http://youtu.be/_XhrtG0sn0Q',NULL,NULL,'video',NULL,NULL,0,0,'2012-03-24 12:43:44','2012-03-24 12:43:44'),('311212142273778_299909040076874',658622931,311212142273778,NULL,'you guys could watch my fancams here! :D\n\nhttp://www.youtube.com/user/xXentii029/videos',NULL,NULL,'link',NULL,NULL,0,1,'2012-03-23 01:56:38','2012-03-23 01:56:38'),('311212142273778_310228022376180',311212142273778,311212142273778,NULL,'Torontoist gives a glowing review of 2K12 Korea Night @ CMW Canadian Music Week\n\n\"Korean pop for beginners: It feels weird, but it doesn’t hurt.\n\nThanks to its sparkly, matching poodle dresses, Tron-era imagery, and general bubble-gum happiness, Canadian Music Week’s Korean music night at the Kool Haus was nothing short of magical—for reasons very different